/**
 * TBAApi - fetch parameter creator
 * @export
 */
export const TBAApiFetchParamCreator = function (
  configuration?: Configuration
) {
  return {
    /**
     * Returns API status, and TBA status information.
     * @param {string} [ifModifiedSince] Value of the &#x60;Last-Modified&#x60; header in the most recently cached response by the client.
     * @param {*} [options] Override http request option.
     * @throws {RequiredError}
     */
    getStatus(ifModifiedSince?: string, options: any = {}): FetchArgs {
      const localVarPath = `/status`;
      const localVarUrlObj = url.parse(localVarPath, true);
      const localVarRequestOptions = Object.assign({ method: 'GET' }, options);
      const localVarHeaderParameter = {} as any;
      const localVarQueryParameter = {} as any;

      // authentication apiKey required
      if (configuration && configuration.apiKey) {
        const localVarApiKeyValue =
          typeof configuration.apiKey === 'function'
            ? configuration.apiKey('X-TBA-Auth-Key')
            : configuration.apiKey;
        localVarHeaderParameter['X-TBA-Auth-Key'] = localVarApiKeyValue;
      }

      if (ifModifiedSince !== undefined && ifModifiedSince !== null) {
        localVarHeaderParameter['If-Modified-Since'] = String(ifModifiedSince);
      }

      localVarUrlObj.query = Object.assign(
        {},
        localVarUrlObj.query,
        localVarQueryParameter,
        options.query
      );
      // fix override query string Detail: https://stackoverflow.com/a/7517673/1077943
      delete localVarUrlObj.search;
      localVarRequestOptions.headers = Object.assign(
        {},
        localVarHeaderParameter,
        options.headers
      );

      return {
        url: url.format(localVarUrlObj),
        options: localVarRequestOptions,
      };
    },
  };
};

